import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';

class Admin extends Component {
	constructor(props) {
		super(props);
		let token = localStorage.getItem('token');

		let loggedin = true;
		if (token == null) {
			loggedin = false;
		}

		this.state = {
			loggedin
		};
	}

	render() {
		if (this.state.loggedin === false) {
			return <Redirect to="/" />;
		}
		return (
			<div>
				<header>

				</header>
				<main>
					
				</main>
				<Link to="/">Logout</Link>
			</div>
		);
	}
}

export default Admin;
